interval(1000).pipe(
  startWith(0),
  concatMap(_ => fromFetch(`https://distributed-systems-movies.sanchezcarlosjr.repl.co/movies/${currentUrl.searchParams.get("imdbid")}/global`, {
  headers: {
    "Authorization": "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOiIxMjM0NTY3ODkwIiwibmFtZSI6IkpvaG4gRG9lIiwiaWF0IjoxNTE2MjM5MDIyfQ.S2ZL7D-D3VeduQ44Cy2qLRFxHV43gRGSZtlfJ2MJ57g"
  }
})),
   map(x => ({
      title: x.title,
      cover: `<img src="${x.imageurl[0]}">`,
      genre: x.genre,
      synopsis: x.synopsis,
      global_platform_rating: x.global_mean.toFixed(2),
      carlos_platform_rating: x.local_rating.toFixed(2),
      reviews:  x.local_users
   })),
   jsonToTree(({key, valueIsObject, value, level}) => valueIsObject ? `<h${level}>${key}</h${level}>` : `<h2>${_.capitalize(key.replaceAll("_", " "))}</h2><p style="margin:0">${value}</p>`)
)

